import collections


PRIME = 10 ** 9 + 7
BASE = 26


def longestDupSubstring(S):

    # Idea behind Rabin-Karp rolling hash is for each substring we calculate a 
    # hash value that can be "rolled" esily.
    # 
    #        [A   D   O   G ]
    #         97 100 111 103
    #   idx   0   1   2   3
    # "ADO" ->   97 * 26^2 + 100 * 26 + 100
    # "DOG" = ("ADO" - 97 * 26 ^ 2) * 26 + 103
    # We can go from "ADO" to "DOG" with:
    #  1 subtraction
    #  1 multiplication by 26
    #  1 addition
    # Essentially O(1)
    #
    # Therefore, this is a hash we can "roll through" a string in O(N) time.
    # NOTE: WE mod everything by a large prime to keep an even distribution of numbers because most numbers are coprime to large primes.

    # This function returns any repeating substring of length lenstr in S in O(N) average time
    def helper(S, lenstr):
        big_base = 26 ** (lenstr - 1) % PRIME
        curr = 0
        for c in S[:lenstr]: curr = (curr * 26 + ord(c)) % PRIME
        table = collections.defaultdict(list)
        table[curr].append(0)

        for idx, ch in enumerate(S[lenstr:], lenstr):
            #print(idx, ch)
            del_num = (big_base * ord(S[idx - lenstr])) % PRIME
            curr -= del_num
            curr = (curr * 26 + ord(S[idx])) % PRIME

            if curr in table:
                currstr = S[idx - lenstr + 1: idx + 1]
                for start in table[curr]:
                    if S[start: start + lenstr] == currstr: return currstr
            table[curr].append(idx - lenstr + 1)
        return ""

    # standard finding biggest of binary search
    left, right = 0, len(S)
    ret = ""
    while left <= right:
        mid = (left + right) // 2
        print(mid)
        temp = helper(S, mid)
        if temp != "":
            ret = temp
            left = mid + 1
        else:
            right = mid - 1
    
    return ret


